import React from 'react'
import Navbar from './Navbar'
import { useEffect, useState } from "react";
import Axios from 'axios'

const Cust_Restro_Landing = props => {
    var restro_name=props.location.val.Rest_Name;
    const[restroDishes,setRestroDishes]=useState([])
    const [cart, setCart] = useState([]);
    useEffect(()=>{
        const url ="http://localhost:3002/getDishesByRestro";
        Axios.post(url,{name:restro_name
        },).then((response)=>{
            setRestroDishes(response.data);
        })
    },[])

    const addToCart =(product)=>{
        setCart([...cart,product]);
        sessionStorage.setItem('length',cart.length);

    }
    return (
        <div>
            <Navbar length/>
            <h3>Welcome to, { restro_name}</h3>
            <h3>Our menu - </h3>
            {restroDishes.map((val,idx)=>{
                return (
                    <div key={idx}>
                        <img src="data:image/jpeg;base64," />
                        <h3><strong>Dish : </strong><strong>{val.Dish_Name}</strong></h3>
                        
                        <h3><strong>Price : </strong><strong>{val.Dish_Price}</strong></h3>
                        
                        <h3><strong>Description : </strong><strong>{val.Description}</strong></h3>

                        <button onClick={()=>addToCart(val)}>Add to cart</button>
                        
                        {/* <h3><strong>Timings : </strong><strong>{val.Rest_Timings}</strong></h3> */}
                        
                    </div>
                );
                

            })}
            
        </div>
    )
}

export default Cust_Restro_Landing
